import React from "react";
import ReactDOM from "react-dom/client";
import DigLog from "./views/Diglog";
import "@/index.css";
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <>
    <DigLog title="友情提示" content="大家好，我是文章内容" />
    <DigLog>
      <button>确定</button>
      <button>取消</button>
    </DigLog>
  </>
);
